import React, { Component } from 'react';
import MainBookPage from './components/MainBookPage'
import {Provider} from "react-redux";
import {Store} from './Store'
import './App.css';

class App extends Component {
  render() {
    return (
      <Provider store={Store}>
      <div className="App">
       <MainBookPage/>
      </div></Provider>
    );
  }
}

export default App;
